        (SELECT count(*) FROM `question` WHERE `questionnaire_id` = NEW.`questionnaire_id`)) THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'User did not answer all mandatory questions';
    END IF;
